import React from 'react';
import { useTheme } from '../hooks/useTheme';

const TestResultPanel = ({ output, isDarkMode }) => {
  const { colors } = useTheme(isDarkMode);

  if (!output) {
    return (
      <div className="h-full flex items-center justify-center" style={{ backgroundColor: colors.background.secondary }}>
        <p style={{ color: colors.text.secondary }}>Run your code to see the results</p>
      </div>
    );
  }

  return (
    <div className="h-full rounded-lg shadow-lg p-4" style={{ backgroundColor: colors.background.secondary }}>
      <div className="flex justify-between items-center mb-2">
        <h2 className="text-lg font-semibold" style={{ color: colors.text.primary }}>
          {output?.isSubmission ? 'Submission Results' : 'Test Results'}
        </h2>
      </div>
      <div className="h-[calc(100%-3rem)] overflow-y-auto custom-scrollbar-dark">
        <div className="rounded-md" style={{ backgroundColor: colors.background.primary }}>
          <div className="p-4">
            {output.error ? (
              <div style={{ color: colors.status.error.text }}>
                <div className="font-semibold">Error:</div>
                <div className="whitespace-pre-wrap">{output.error}</div>
                {output.details && (
                  <div className="mt-2 text-sm opacity-75 whitespace-pre-wrap">
                    {output.details}
                  </div>
                )}
              </div>
            ) : (
              <>
                {output.isSubmission && output.submissionStatus && (
                  <div className="mb-4 p-3 rounded" style={{
                    backgroundColor: output.submissionStatus === 'Accepted' 
                      ? colors.status.success.background 
                      : colors.status.error.background,
                    color: output.submissionStatus === 'Accepted' 
                      ? colors.status.success.text 
                      : colors.status.error.text
                  }}>
                    <div className="font-semibold">
                      Status: {output.submissionStatus}
                    </div>
                    {output.runtime && (
                      <div className="text-sm" style={{ color: colors.text.secondary }}>
                        Runtime: {output.runtime}ms
                      </div>
                    )}
                    {output.memory && (
                      <div className="text-sm" style={{ color: colors.text.secondary }}>
                        Memory: {output.memory}MB
                      </div>
                    )}
                  </div>
                )}
                {output.stdout && (
                  <div className="mb-2">
                    <div className="font-semibold" style={{ color: colors.text.primary }}>
                      Standard Output:
                    </div>
                    <div className="whitespace-pre-wrap font-mono text-sm" style={{ color: colors.text.secondary }}>
                      {output.stdout}
                    </div>
                  </div>
                )}
                {output.testResults && output.testResults.length > 0 && (
                  <div className="space-y-4">
                    {output.testResults.map((result, index) => (
                      <div
                        key={index}
                        className="p-3 rounded"
                        style={{
                          backgroundColor: result.passed 
                            ? colors.status.success.background 
                            : colors.status.error.background,
                          color: result.passed 
                            ? colors.status.success.text 
                            : colors.status.error.text
                        }}
                      >
                        <div className="font-semibold">
                          Test Case {index + 1}: {result.passed ? 'Passed' : 'Failed'}
                        </div>
                        <div className="mt-1 text-sm" style={{ color: colors.text.secondary }}>
                          <div>Input: {result.input}</div>
                          <div>Expected: {result.expectedOutput}</div>
                          <div>Actual: {result.actualOutput}</div>
                        </div>
                      </div>
                    ))}
                  </div>
                )}
              </>
            )}
          </div>
        </div>
      </div>
    </div>
  );
};

export default TestResultPanel;
